@navypierchicago was just named @usatoday's best place in the U.S. to watch fireworks! 

This image was from a photoshoot I executed a few years back shortly after Navy Pier's South Dock renovations were compete. 

Chicago's fireworks are easy to take for granted as a long-time resident but there's definitely something special when you're out on a gorgeous summer night and happen to be within eyeshot of them. 
